	[script]
	id="dplat_toggle_all"
		[modification]
		on_process="[
			map(
				map([
					'dplat1', 'dplat2', 'dplat3', 'dplat4',
					'dplat5', 'dplat6', 'dplat7', 'dplat8'
					], 'obj_id', get_object(level, obj_id)
				), 'dplat_obj', [
					set(dplat_obj.y, dplat_obj.y + dplat_shift),
					set(dplat_obj.vars.move_y1, dplat_obj.vars.move_y1 + dplat_shift),
					set(dplat_obj.vars.move_y2, dplat_obj.vars.move_y2 + dplat_shift)
				]
			) where dplat_shift = (vars.dungeon_crawling_dplat_state * 158),
			end_script()
		]"
		target="level.player"
		[/modification]

	[/script]

	[script]
	id="platform1_toggle"
		[modification]
		on_process="[
			set(vars.dungeon_crawling_platform1_state, (not vars.dungeon_crawling_platform1_state)),
			if(vars.dungeon_crawling_platform1_state,
				[set(platform.vars.move_y1, -96), set(platform.vars.move_y2, 352)],
				[set(platform.vars.move_y1, platform.y), set(platform.vars.move_y2, platform.y + 32)]
			) where platform = get_object(level, 'platform1'),
			end_script()
		]"
		target="level.player"
		[/modification]

	[/script]

